import { Routes, Route, Link } from "react-router-dom";
import Home from "./pages/home";
import Category from "./pages/category";


function App() {
    // return <Home /> ;
    return ( <
        > { /* <Home/> */ } <
        header >
        <
        Link to = "/" > Home < /Link> <
        Link to = "/category" > Category < /Link> <
        /header>


        <
        Routes >
        <
        Route path = "/"
        element = { < Home / > } > < /Route> <
        Route path = "/category"
        element = { < Category / > } > < /Route> <
        /Routes> <
        />

    )
}

export default App;
